<script>
  document.getElementById('processData').addEventListener('click',function() {
	var data =   document.getElementById('data').value.replace(/NULL/g,"null").replace(/\\'/g,"'");
	var dataSegments = data.split("),");
	var testSuiteData = document.getElementById('testSuiteData').value.split("\n");
	console.log(testSuiteData);
	
	
	//(`id`, `generated_data_count`, `end_date_time`, `message`, `result`, `runtime_milliseconds`, `start_date_time`, `username`, `record_type_id`, `test_suite_id`)
	for(var index = 0; index < dataSegments.length; index++){
		var element = dataSegments[index];
		element = element.substring(1);
		console.log("Processing Index: " + index + " Element: " + element);
		
		var segment = element.match(/('.*?'|[^",\s]+)(?=\s*,|\s*$)/g);
		var result;
		var startDateTime;
		var endDateTime;
		var message;
		var username;
		var generatedDataCount;
		var toolID;
		var testCaseID;
		var testSuiteID;

		result = segment[4].substring(1, segment[4].length-1);
		//console.log("'" + result + "'");
		if(result == ""){
			result = true;
		}
		else if(result.localeCompare('\0')){
			result = false;
		}
		else{
			console.log("ERROR 1: " + result);
		}
		
		message = segment[3];
		
		
		
		startDateTime = convertTime(segment[6].substring(1, segment[6].length-1));
		endDateTime = convertTime(segment[2].substring(1, segment[2].length-1));
		username = segment[7].substring(1, segment[7].length-1);
		generatedDataCount = segment[1];
		if(generatedDataCount == "null")
			generatedDataCount = 0;
		
		testSuiteID = segment[9].replace(")","");
		var testSuiteSegs = testSuiteData[testSuiteID -1].split(",");
		toolID = testSuiteSegs[1];
		testCaseID = testSuiteSegs[2];
		
		
		var jsonStr = "{";
		
		if(message != null && message.length > 0)
			jsonStr += '"message":"' + message + '",';
		
		jsonStr += '"result": %RESULT%,"startDateTime": "%startDateTime%","endDateTime": "%endDateTime%","username": "%username%","generatedDataCount": %generatedDataCount%,"generatedDataType": {"toolId": %toolId%},"testCase": {"id": %testCaseID%}}';
		
		jsonStr = jsonStr.replace("%RESULT%",result);
		jsonStr = jsonStr.replace("%startDateTime%",startDateTime);
		jsonStr = jsonStr.replace("%endDateTime%",endDateTime);
		jsonStr = jsonStr.replace("%username%",username);
		jsonStr = jsonStr.replace("%generatedDataCount%",generatedDataCount);
		jsonStr = jsonStr.replace("%toolId%",toolID);
		jsonStr = jsonStr.replace("%testCaseID%",testCaseID);
		console.log("Completed Index: " + index);	
		document.getElementById('full').value =  document.getElementById('full').value + "\n" + jsonStr;
		document.getElementById('json').value = jsonStr;
		document.getElementById('saveoutput').click();
	}
	});

function convertTime(time){
	if(time == null)
		return null;
	time = time.replace(" ","T");
	time = time + "Z";
	return time;
}
